/**
 * protonThemes Custom Fields JavaScript
 *
 * All JavaScript logic for fields in the post meta box.
 * @since 2.2.3
 *
 */
 	protonFieldMethods.time = {
	 	_init: function(element){
			element.find( '.proton_input_clockpicker' ).clockpicker();
		},
		_destroy: function(element){
			if(element.find( '.proton_input_clockpicker' )){
				element.find( '.proton_input_clockpicker' ).clockpicker('remove');
			}
		}
 	};
(function ($) {

/**
 * Execute the above methods in the protonthemesCustomFields object.
 *
 * @since 2.2.3
 */
		$(document).ready(function () {
			$( '.proton-field-type-time' ).each(function(){
		 		protonFieldMethods.time._init($(this));
	 		});
		});



})(jQuery);

